import React from "react";
import "../styles/login.css";
import "../styles/main.css";
import image from "../assets/login-image.jpg";

export const Login = () => {
  return (
    <div className="login-container">
      <div className="login">
        <h1>hello</h1>
      </div>
      <img className="login-image" src={image} alt="" />
    </div>
  );
};
